    <div className="AboutMe">
      <div className="AboutMe-container">
        <div className="AboutMe-text">
        <h1>About Me</h1>

          Hi, I'm Zoe Neale, a passionate aerialist specializing in silks and sling, and a dedicated model. I bring the worlds of grace and strength together in my performances.

          <h2>Aerialist:</h2>
          I soar through the skies with silks and sling, blending athleticism and artistry to create captivating moments.

